import React, { useState } from "react";
import Layout from "../../components/Layout/Layout";
import TableFournisseur from "../../components/TableFournisseur/TableFournisseur";

function Dashbord() {
  const [showTable, setShowTable] = useState(false);
  const [showTableMateriel, setShowTableMateriel] = useState(false);
  const [showTableRessouce, setShowTableRessource] = useState(false);

  const handleFournisseurClick = () => {
    setShowTable(true);
  };
  const handleRessourceClick = () => {
    setShowTableRessource(true);
  };
  const handleMaterielClick = () => {
    setShowTableMateriel(true);
  };

  return (
    <div>
      <Layout>
        <div className="flex flex-col justify-center items-center text-xl gap-5 my-20">
          <li>
            <button href="/fournisseur" onClick={handleFournisseurClick}>
              fournisseur
            </button>
          </li>
          <li>
            <a href="/ressource" onClick={handleRessourceClick}>ressource</a>
          </li>
          <li>
            <a href="/materiaux" onClick={handleMaterielClick}>materiaux</a>
          </li>
        </div>
      </Layout>

      {showTable && <TableFournisseur />}
    </div>
  );
}

export default Dashbord;
